    margin:0 auto;
    display:flex;
    justify-content:center;
    align-items:center;
}
.contact, .direction{
    margin-bottom:2%;
}
.img{
    width: 6%;
    margin-bottom:5%;
    img{
        width:100%;
    }
}
.contact{

    display:flex;
    flex-direction:column;
}
.direction{

}
`;

export { FooterStyle };
